('default', 'active', 'ACTIVE_MAIN', '{$this->table}\r\n  <tr>\r\n    <td colspan=''3'' class=''header''>\r\n      {$this->lang->active_users}\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td style=''width:40%'' class=''subheader''>{$this->lang->active_user}</td>\r\n    <td style=''width:30%'' class=''subheader''>{$this->lang->active_last_action}</td>\r\n    <td style=''width:30%'' class=''subheader''>{$this->lang->active_time}</td>\r\n  </tr>\r\n\r\n  {$ActiveList}\r\n\r\n  <tr>\r\n    <td colspan=''3'' class=''footer''>&nbsp;</td>\r\n  </tr>\r\n{$this->etable}', 'Active Users Table', 'The active users table formatting and generalized code.', 0),
('default', 'active', 'ACTIVE_USER', '  <tr>\r\n    <td class=''tablelight''>{$username}</td>\r\n    <td class=''tablelight''>{$action}</td>\r\n    <td class=''tablelight''>{$time}</td>\r\n  </tr>', 'Active Users Table Entry', 'Format the look of the entry for a user in the Active Users main table listing.', 1),
('default', 'board', 'BOARD_CATEGORY', '  <tr>\r\n    <td colspan=''4'' class=''subheader''><a href=''{$this->self}?c={$forum[''forum_id'']}'' class=''subheader''>{$forum[''forum_name'']}</a></td>\r\n  </tr>', 'Board Category', 'Format the look of the categories on the index page of your forum.', 2),
