('default', 'post', 'POST_BOX_PLAIN', '  <tr>\r\n    <td class=''tablelight'' style=''width:30%'' valign=''top'' align=''center''>\r\n      <div style=''text-align:left''><b>{$this->lang->post_msg}</b><br />[<a href=''#'' onclick=''return getLength()''>{$this->lang->post_length}</a>]<br /><br /><br /></div>\r\n\r\n      <table border=''0'' cellpadding=''0'' cellspacing=''0''>\r\n      <tr><td>\r\n      {$this->table}\r\n        <tr>\r\n          <td colspan=''{$this->sets[''clickable_per_row'']}'' class=''tabledark'' align=''center'' style=''white-space:nowrap''>\r\n            <b>{$this->lang->post_smiles}</b>\r\n          </td>\r\n        </tr>\r\n        {$clickable}\r\n      {$this->etable}\r\n      </td></tr></table>\r\n\r\n    </td>\r\n    <td class=''tablelight''>\r\n<script type=''text/javascript''>\r\n<!--\r\nfunction getLength(){\r\n  var length = form["post"].value.length;\r\n  alert("{$this->lang->post_mbcode_length}");\r\n\r\n  return false;\r\n}\r\n\r\nfunction insertSmiley(smiley) {\r\n  insertCode(getText() + '' '' + smiley);\r\n  return false;\r\n}\r\n\r\nfunction insertCode(code) {\r\n  var el = form["post"];\r\n  if (window.getSelection) {\r\n    if (el.selectionStart != el.selectionEnd) {\r\n      el.value = el.value.substring(0, el.selectionStart) + code\r\n              + el.value.substring(el.selectionEnd, el.value.length);\r\n      el.selectionStart = el.value.length;\r\n      el.selectionEnd = el.value.length;\r\n    } else {\r\n      el.value = el.value.substring(0, el.selectionStart) + code\r\n              + el.value.substring(el.selectionStart, el.value.length);\r\n    }\r\n  } else if (el.createTextRange && el.caretPos) {\r\n    el.caretPos.text = code;\r\n  } else {\r\n    el.value += code;\r\n  }\r\n  el.focus();\r\n}\r\n\r\nfunction storeCaret(el) {\r\n  if (el.createTextRange) {\r\n    el.caretPos = document.selection.createRange().duplicate();\r\n  }\r\n}\r\n\r\nfunction getText() {\r\n  if (document.all) {\r\n    if (form["post"].createTextRange && form["post"].caretPos) {\r\n      return form["post"].caretPos.text;\r\n    } else {\r\n      return "";\r\n    }\r\n  } else if (window.getSelection) {\r\n    return form["post"].value.substring(form["post"].selectionStart, form["post"].selectionEnd);\r\n  } else {\r\n    return "";\r\n  }\r\n}\r\n\r\nfunction mbCode(e) {\r\n  var tag = e.name;\r\n  var text = getText();\r\n\r\n  if (text) {\r\n    var code = "[" + tag + "]" + text + "[/" + tag + "]";\r\n  } else {\r\n    if (e.value.indexOf("*") != -1) {\r\n      var code = "[/" + tag + "]";\r\n      e.value = e.value.substring(0,(e.value.length-1));\r\n    } else {\r\n      var code = "[" + tag + "]";\r\n      e.value += "*";\r\n    }\r\n  }\r\n\r\n  insertCode(code);\r\n}\r\n\r\nfunction mbcURL(e) {\r\n  var type = e.name;\r\n  var text = getText();\r\n  var isURL = (text.substring(0,7) == "http://");\r\n\r\n  if (type == ''img'') {\r\n    if (isURL) {\r\n      var code = "[img]" + text + "[/img]";\r\n    } else {\r\n      var code = text + "[img]" + prompt("{$this->lang->post_mbcode_url}:","") + "[/img]";\r\n    }\r\n  } else {\r\n    var code = "[" + type + "=" + (isURL ? text : prompt("{$this->lang->post_mbcode_address}:","")) + "]" + ((text && !isURL) ? text : prompt("{$this->lang->post_mbcode_detail}:","")) + "[/" + type + "]";\r\n  }\r\n  insertCode(code);\r\n}\r\n\r\nfunction mbcFont(list) {\r\n  var attrib = list.name.substring(1,list.name.length);\r\n  var value = list.options[list.selectedIndex].value;\r\n  if (value && attrib) {\r\n    insertCode("[" + attrib + "=" + value + "]" + getText() + "[/" + attrib + "]");\r\n  }\r\n  setTimeout("form[''"+list.name+"''].options[0].selected = true",10);\r\n}\r\n\r\nvar form = document.forms["mbpost"];\r\n//-->\r\n</script>\r\n      <table border="0" cellpadding="0" cellspacing="2">\r\n        <tr>\r\n          <td><input type="button" onclick="mbCode(this)" name="b" title="{$this->lang->post_mbcode_bold}" accesskey="b" class="mbcButton" value="{$this->lang->post_mbcode_bold1}" style="font-weight:bold" /></td>\r\n          <td><input type="button" onclick="mbCode(this)" name="i" title="{$this->lang->post_mbcode_italic}" accesskey="i" class="mbcButton" value=" {$this->lang->post_mbcode_italic1}" style="font-style:italic" /></td>\r\n          <td><input type="button" onclick="mbCode(this)" name="u" title="{$this->lang->post_mbcode_underline}" accesskey="u" class="mbcButton" value="{$this->lang->post_mbcode_underline1}" style="text-decoration:underline" /></td>\r\n          <td><input type="button" onclick="mbCode(this)" name="s" title="{$this->lang->post_mbcode_strike}" accesskey="s" class="mbcButton" value="{$this->lang->post_mbcode_strike1}" style="text-decoration:line-through" /></td>\r\n          <td>&nbsp;</td>\r\n          <td><input type="button" onclick="mbCode(this)" name="php" title="{$this->lang->post_mbcode_php}" accesskey="p" class="mbcButton" value="{$this->lang->post_mbcode_php}" /></td>\r\n          <td><input type="button" onclick="mbCode(this)" name="code" title="{$this->lang->post_mbcode_code}" accesskey="c" class="mbcButton" value="{$this->lang->post_mbcode_code}" /></td>\r\n          <td><input type="button" onclick="mbCode(this)" name="quote" title="{$this->lang->post_mbcode_quote}" accesskey="q" class="mbcButton" value="{$this->lang->post_mbcode_quote}" /></td>\r\n          <td>&nbsp;</td>\r\n          <td><input type="button" onclick="mbcURL(this)" name="url" title="{$this->lang->post_mbcode_url}" accesskey="h" class="mbcButton" value="{$this->lang->post_mbcode_url}" /></td>\r\n          <td><input type="button" onclick="mbcURL(this)" name="email" title="{$this->lang->post_mbcode_email}" accesskey="e" class="mbcButton" value="@" /></td>\r\n          <td><input type="button" onclick="mbcURL(this)" name="img" title="{$this->lang->post_mbcode_image}" accesskey="k" class="mbcButton" value="{$this->lang->post_mbcode_image1}" /></td>\r\n        </tr>\r\n        <tr>\r\n          <td colsp