arch_day}</option>\r\n              <option value=''3''>3 {$this->lang->search_days}</option>\r\n              <option value=''7''>1 {$this->lang->search_week}</option>\r\n              <option value=''14''>2 {$this->lang->search_weeks}</option>\r\n              <option value=''31'' selected=''selected''>1 {$this->lang->search_month}</option>\r\n              <option value=''92''>3 {$this->lang->search_months}</option>\r\n              <option value=''183''>6 {$this->lang->search_months}</option>\r\n              <option value=''365''>1 {$this->lang->search_year}</option>\r\n            </select>\r\n          </td>\r\n        </tr>\r\n      </table>\r\n    </td>\r\n  </tr>\r\n  <tr>\r\n    <td colspan=''2'' class=''footer'' align=''center''>\r\n      <input type=''submit'' name=''submit'' value=''{$this->lang->search_search}'' />\r\n    </td>\r\n  </tr>\r\n{$this->etable}\r\n</form>', 'Display List Page', 'This page shows the list of forums and input for entering search terms', 0),
('default', 'search', 'SEARCH_RESULTS_ENTRY', '<tr>\r\n <td class=''subheader''><a href=''{$this->self}?a=topic&amp;t={$search[''post_topic'']}''><b>{$search[''topic_title'']}</b></a></td>\r\n <td class=''subheader'' align=''center''><a href=''{$this->self}?a=forum&amp;f={$search[''topic_forum'']}''><b>{$search[''forum_name'']}</b></a></td>\r\n <td class=''subheader'' align=''center''><b>$topic_starter</b></td>\r\n <td class=''subheader'' align=''center''><b>{$search[''topic_replies'']}</b></td>\r\n <td class=''subheader'' align=''center''><b>$matches</b></td>\r\n</tr>', 'Results Entry', 'This is the format for an entry in the results view.', 2),
('default', 'search', 'SEARCH_RESULTS_GUEST_INFO', '<b>{$this->lang->search_guest}<br />{$this->lang->search_unreg}</b><br /><br />', 'Search Results Guest Info', '', 5),
('default', 'search', 'SEARCH_RESULTS_MAIN', '{$this->table}\r\n  <tr>\r\n    <td colspan=''5''>$pages</td>\r\n  </tr>\r\n  <tr>\r\n    <td style=''width:30%'' class=''header''>{$this->lang->search_topic}</td>\r\n    <td style=''width:25%'' class=''header'' align=''center''>{$this->lang->search_forum}</td>\r\n    <td style=''width:20%'' class=''header'' align=''center''>{$this->lang->search_starter}</td>\r\n    <td style=''width:10%'' class=''header'' align=''center''>{$this->lang->search_replies}</td>\r\n    <td style=''width:10%'' class=''header'' align=''center''>{$this->lang->search_matches}</td>\r\n  </tr>\r\n  $results\r\n  <tr>\r\n    <td colspan=''5'' class=''footer''>&nbsp;</td>\r\n  </tr>\r\n  <tr>\r\n    <td colspan=''5''>$pages</td>\r\n  </tr>\r\n{$this->etable}', 'Results Page', 'This is the main format for the results view', 1),
('default', 'search', 'SEARCH_RESULTS_MEMBER_INFO', '<IF $online><img src=''./skins/{$this->skin}/images/online.gif'' alt=''{$this->lang->search_online}'' title=''{$this->lang->search_online}'' /></IF>\r\n<b><a href=''{$this->self}?a=profile&amp;w={$match[''post_author'']}''>{$match[''user_name'']}</a><br />\r\n{$match[''user_title'']}</b><br /><br />\r\n{$match[''user_avatar'']}\r\n\r\n<img src=''./skins/{$this->skin}/images/{$match[''membertitle_icon'']}'' alt=''{$this->lang->search_level}'' /><br /><br />\r\n\r\n{$this->lang->search_group}: {$match[''group_name'']}<br />\r\n{$this->lang->search_posts}: {$match[''user_posts'']}<br />\r\n{$this->lang->search_joined}: {$match[''user_joined'']}<br /><br />', 'Search Results Member Information', '', 4),
('default', 'search', 'SEARCH_RESULTS_POST', '<tr>\r\n  <td class=''$class'' colspan=''5''>\r\n    <table border=''0'' width=''100%'' cellpadding=''4'' cellspacing=''0''>\r\n      <tr>\r\n        <td style=''width:20%'' rowspan=''3'' valign=''top''>\r\n          {$Poster_Info}\r\n          {$match[''post_ip'']}\r\n        </td>\r\n      </tr>\r\n      <tr>\r\n        <td class=''post'' style=''width:80%'' valign=''top''>\r\n          {$match[''post_text'']}\r\n        </td>\r\n      </tr>\r\n      <tr>\r\n        <td valign=''bottom''>\r\n          <table border=''0'' cellpadding=''0'' cellspacing=''0'' width=''100%''>\r\n            <tr>\r\n              <td colspan=''3''><hr /></td>\r\n            </tr>\r\n            <tr>\r\n              <td style=''width:1px''>{$match[''post_icon'']}</td>\r\n              <td>{$this->lang->search_posted_on} {$match[''post_time'']}</td>\r\n              <td align=''right''><b>{$match[''score'']}</b></td>\r\n            </tr>\r\n          </table>\r\n        </td>\r\n      </tr>\r\n    </table>\r\n  </td>\r\n</tr>', 'Search Results Post Entry', 'An individual post that was matched by the search', 3),
('default', 'topic', 'TOPIC_MAIN', '{$PollDisplay}\r\n\r\n{$this->table}\r\n  <tr>\r\n    <td>{$this->lang->topic_pages}:\r\n      {$pagelinks}\r\n    </td>\r\n    <td align=''right''>\r\n      {$replylink}\r\n      <a href=''{$this->self}?a=post&amp;s=topic&amp;f={$topic[''topic_forum'']}''><img src=''./skins/{$this->skin}/images/newtopic.gif'' alt=''{$this->lang->topic_create_topic}'' /></a>\r\n      <a href=''{$this->self}?a=post&amp;s=poll&amp;f={$topic[''topic_forum'']}''><img src=''./skins/{$this->skin}/images/newpoll.gif'' alt=''{$this->lang->topic_create_poll}'' /></a>\r\n    </td>\r\n  </tr>\r\n{$this->etable}\r\n\r\n<form action=''{$this->self}?a=mod&amp;s=split&amp;t={$this->get[''t'']}'' method=''post''>\r\n{$this->table}\r\n  <tr>\r\n    <td class=''header''>\r\n      {$title_html}{$topic[''topic_description'']}\r\n    </td>\r\n  </tr>\r\n\r\n  {$posts}\r\n\r\n  <tr>\r\n    <td class=''footer'' align=''right''>\r\n      {$mod_opts}\r\n    </td>\r\n  </tr>\r\n{$this->etable}\r\n</form>\r\n\r\n{$this->table}\r\n  <tr>\r\n    <td>{$this->lang->topic_pages}:\r\n      {$pagelinks}\r\n    </td>\r\n    <td align=''right''>\r\n      {$replylink}\r\n      <a href=''{$this->self}?a=post&amp;s=topic&amp;f={$topic[''topic_forum'']}''><img src=''./skins/{$this->skin}/images/newtopic.gif'' alt=''{$this->lang->topic_create_topic}'' /></a>\r\n      <a href=''{$this->self}?a=post&amp;s=poll&amp;f={$topic[''topic_forum'']}''><img src=''./skins/{$this->skin}/images/newpoll.gif'' alt=''{$this->lang->topic_create_poll}'' /></a>\r\n      <a href=''{$this->self}?a=cp&amp;s=addsub&amp;type=topic&amp;item={$this->get[''t'']}''><img src=''./skins/{$this->skin}/images/subscribe.gif'' alt=''{$this->lang->topic_subscribe}'' /></a>\r\n      <a href=''{$this->self}?a=printer&amp;t={$this->get[''t'']}''><img src=''./skins/{$this->skin}/images/printable.gif'' alt=''{$this->lang->topic_print}'' /></a>\r\n    </td>\r\n  </tr>\r\n{$this->etable}', 'Topic View', 'Change the appearance of topics', 0),
('default', 'topic', 'TOPIC_POST', '<tr>\r\n  <td class=''{$class}''>\r\n    <a id=''p{$i}''></a>\r\n    <table border=''0'' width=''100%'' cellpadding=''4'' cellspacing=''0''>\r\n      <tr>\r\n        <td style=''width:20%'' rowspan=''3'' valign=''top''>\r\n          {$split}\r\n          {$Poster_Info}\r\n          {$post[''post_ip'']}\r\n        </td>\r\n      </tr>\r\n      <tr>\r\n        <td class=''post'' valign=''top''>\r\n          <table border=''0'' cellpadding=''0'' cellspacing=''0'' width=''100%''>\r\n            <tr>\r\n              <td>{$Poster_Icons}</td>\r\n              <td align=''right''><a href=''{$this->self}?a=post&amp;s=reply&amp;t={$this->get[''t'']}&amp;f={$topic[''topic_forum'']}&amp;qu={$post[''post_id'']}''><img src=''./skins/{$this->skin}/images/quote.gif'' alt=''{$this->lang->topic_quote}'' /></a> {$options} <a href=''#top''><img src=''./skins/{$this->skin}/images/arrowup.gif'' alt=''{$this->lang->topic_top}'' title=''{$this->lang->topic_top}'' /></a></td>\r\n            </tr>\r\n          </table>\r\n          <hr />\r\n          {$post[''post_text'']}\r\n        </td>\r\n      </tr>\r\n      <tr>\r\n        <td valign=''bottom''>\r\n          <table border=''0'' cellpadding=''0'' cellspacing=''0'' width=''100%''>\r\n            <tr>\r\n              <td colspan=''2''><span class=''signature''>{$post[''user_signature'']}</span><hr /></td>\r\n            </tr>\r\n            <tr>\r\n              <td>{$post[''post_icon'']}{$this->lang->topic_posted} {$post[''post_time'']}</td>\r\n              <td align=''right''>{$edited}</td>\r\n            </tr>\r\n          </table>\r\n        </td>\r\n      </tr>\r\n    </table>\r\n  </td>\r\n</tr>\r\n', 'Posts', 'Format the look of a post within a given topic.', 1),
('default', 'topic', 'TOPIC_POSTER_GUEST', '<b>{$this->lang->topic_guest}<br />{$this->lang->topic_unreg}</b><br /><br />', 'Poster Information - Guest', 'Edit the poster information in topics for unregistered members', 3),
('default', 'topic', 'TOPIC_POSTER_MEMBER', '<IF $online><img src=''./skins/{$this->skin}/images/online.gif'' alt=''{$this->lang->topic_online}'' title=''{$this->lang->topic_online}'' /></IF>\r\n<b><a href=''{$this->self}?a=profile&amp;w={$post[''user_id'']}''>{$post[''user_name'']}</a><br />\r\n{$post[''user_title'']}</b><br /><br />\r\n{$post[''user_avatar'']}\r\n\r\n<img src=''./skins/{$this->skin}/images/{$post[''membertitle_icon'']}'' alt=''{$this->lang->topic_level}'' /><br /><br />\r\n\r\n{$this->lang->topic_group}: {$post[''group_name'']}<br />\r\n{$this->lang->topic_posts}: {$post[''user_posts'']}<br />\r\n{$this->lang->topic_joined}: {$post[''user_joined'']}<br /><br />', 'Poster Information - Member', 'Edit the poster information in topics for members', 2);
